import React from "react";
import Card from "../Card";

const Articles = ({ articles }) => {
  return (
    <Query query={CARD}>
      {({ data: { articles } }) => {
        return (
        <div class="container">
          <div class="row">
            <div class="col-md-8">
              <div class="card mb-4">
                <div class="card-body">
                  {articles.map((article, i) => {
                    return (
                      <h2 class="card-title">{articles[0].title}</h2>
                    );
                    })}
                </div>
              </div>
            </div>
          </div>
        </div>
        );
      }}
    </Query>
  );
};
export default Articles;
